window.bookSummaryJSON = "<p>Narrator Vikas Adams pushes the boundaries of LitRPG to the next level, bringing this immersive VR gaming drama to nerve-jangling nirvana.&nbsp;&nbsp;</p> <p>Pro-gamer and eighth grade teacher Chris is preoccupied by thoughts of how to save his brother when he gets an invitation he can't resist:&nbsp;</p> <p><i>Want to play Euphoria for free?</i>&nbsp;</p> <p>The free pass brings him to a portal for the newest and most awesome game in the universe. Chris agrees to play Euphoria Online in Death March mode, a secret and deadly level of the game. The real-life consequences of the game mean that if Chris can emerge victorious from a virtual six-month battle with necromancers, ogres, and wyverns, his brother goes free. But if he loses, well, game over.&nbsp;&nbsp;</p>"; 
